import './App.css';

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import infoForm from './components/InfoForm';

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/student/getInformation" element={<infoForm />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
